import React from 'react'

function Card({items}) {
    const itemList=items.length?(
        items.map(item=>{
            return(
                <div className="collection-item" key={item.id}>
                    <h6 style={{color:"red"}}>Expense</h6>
                    <br/>
                    <div >
                    <span>{item.content_ex}</span>
                    <br/>
                    <span>Rs.{item.price_ex}</span>
                    <br/>
                    </div>
                    <h6 style={{color:"green",backgroundColor:"blanchedalmond"} }>Income</h6>               
                    <div>
                    <span>{item.content_in}</span>
                    <br/>
                    <span>Rs.{item.price_in}</span>
                    <br/>
                    </div>

                </div>
            )
        })
    ):
        (<p className="center">You have no expenses nor savings,add something to your list</p>)


    return (
        <div className="todos collection">
            {itemList}
        </div>
    )
}

export default Card
